          <HomePage />
        </Route>
        {/*  {!authCtx.isLoggedIn && ( */}
        <Route path="/auth">
          <AuthPage />
        </Route>
        {/* )} */}

        <Route path="/dashboard">
          {/* {authCtx.isLoggedIn && <UserProfile />}
          {!authCtx.isLoggedIn && <Redirect to="/auth" />} */}
          <UserProfile />
        </Route>

        <Route path="*">
          <Redirect to="/" />
        </Route>
      </Switch>
    </Layout>
  );
}

export default App;
